import Register from "./pages/Register.jsx"

function App() {
  return (
    <Router>
        <Routes>
        <Route path="/" element={<SignIn/>}/>
        <Route path="/signup" element={<R/>}/>
      </Routes>
      </Router>
  );
}

export default App;
